rk(A :: p1 ::  nil) = 2 -> rk(A :: B :: p1 ::  nil) = 2 -> rk(Ap :: Bp :: Cp :: Dp :: Ep :: p1 ::  nil) = 5 ->
rk(A :: p2 ::  nil) = 2 -> rk(A :: C :: p2 ::  nil) = 2 -> rk(Ap :: Bp :: Cp :: Dp :: Ep :: p2 ::  nil) = 5 ->
rk(A :: p3 ::  nil) = 1 -> rk(A :: D :: p3 ::  nil) = 2 -> rk(Ap :: Bp :: Cp :: Dp :: Ep :: p3 ::  nil) = 5 ->
rk(A :: p4 ::  nil) = 2 -> rk(A :: E :: p4 ::  nil) = 2 -> rk(Ap :: Bp :: Cp :: Dp :: Ep :: p4 ::  nil) = 5 ->
rk(B :: C :: p5 ::  nil) = 2 -> rk(Ap :: Bp :: Cp :: Dp :: Ep :: p5 ::  nil) = 5 -> rk(D :: p3 ::  nil) = 2.
Proof.

intros A B C D E Ap Bp Cp Dp Ep p1 p2 p3 p4 p5 
HABCDEeq HApBpCpDpEpeq HABCDEApBpCpDpEpeq HAp1eq HABp1eq HApBpCpDpEpp1eq HAp2eq HACp2eq HApBpCpDpEpp2eq HAp3eq
HADp3eq HApBpCpDpEpp3eq HAp4eq HAEp4eq HApBpCpDpEpp4eq HBCp5eq HApBpCpDpEpp5eq .

(* dans constructProofaux(), preuve de 1 <= rg <= 2 pour Dp3 requis par la preuve de (?)Dp3 pour la règle 4  *)
(* Application de la règle 4 code (7 ou 8 dans la thèse) concerne B (rang 2 et 2) *)
(* marque des antécédents AUB AiB A: -4 -2 et -4*)
(* ensembles concernés AUB : A :: D :: p3 ::  de rang :  2 et 2 	 AiB : p3 ::  de rang :  1 et 1 	 A : A :: p3 ::   de rang : 1 et 1 *)
assert(HDp3m2 : rk(D :: p3 :: nil) >= 2).
{
	assert(HAp3Mtmp : rk(A :: p3 :: nil) <= 1) by (solve_hyps_max HAp3eq HAp3M1).
	assert(HADp3mtmp : rk(A :: D :: p3 :: nil) >= 2) by (solve_hyps_min HADp3eq HADp3m2).
	assert(Hp3mtmp : rk(p3 :: nil) >= 1) by (solve_hyps_min Hp3eq Hp3m1).
	assert(Hincl : incl (p3 :: nil) (list_inter (A :: p3 :: nil) (D :: p3 :: nil))) by (repeat clear_all_rk;my_inO).
	assert(HT1 : equivlist (A :: D :: p3 :: nil) (A :: p3 :: D :: p3 :: nil)) by (clear_all_rk;my_inO).
	assert(HT2 : equivlist (A :: p3 :: D :: p3 :: nil) ((A :: p3 :: nil) ++ (D :: p3 :: nil))) by (clear_all_rk;my_inO).
	try rewrite HT1 in HADp3mtmp;try rewrite HT2 in HADp3mtmp.
	assert(HT := rule_4 (A :: p3 :: nil) (D :: p3 :: nil) (p3 :: nil) 2 1 1 HADp3mtmp Hp3mtmp HAp3Mtmp Hincl); apply HT.
}

assert(HDp3M : rk(D :: p3 ::  nil) <= 2) (* dim : 5 *) by (solve_hyps_max HDp3eq HDp3M2).
assert(HDp3m : rk(D :: p3 ::  nil) >= 1) by (solve_hyps_min HDp3eq HDp3m1).
intuition.
Qed.

