rk(A :: B :: C :: D :: E ::  nil) = 5 -> rk(Ap :: Bp :: Cp :: Dp :: Ep ::  nil) = 5 -> rk(A :: B :: C :: D :: E :: Ap :: Bp :: Cp :: Dp :: Ep ::  nil) = 6 ->
rk(A :: p1 ::  nil) = 2 -> rk(A :: B :: p1 ::  nil) = 2 -> rk(Ap :: Bp :: Cp :: Dp :: Ep :: p1 ::  nil) = 5 ->
rk(A :: p2 ::  nil) = 2 -> rk(A :: C :: p2 ::  nil) = 2 -> rk(Ap :: Bp :: Cp :: Dp :: Ep :: p2 ::  nil) = 5 ->
rk(A :: p3 ::  nil) = 1 -> rk(A :: D :: p3 ::  nil) = 2 -> rk(Ap :: Bp :: Cp :: Dp :: Ep :: p3 ::  nil) = 5 ->
rk(A :: p4 ::  nil) = 2 -> rk(A :: E :: p4 ::  nil) = 2 -> rk(Ap :: Bp :: Cp :: Dp :: Ep :: p4 ::  nil) = 5 ->
rk(B :: C :: p5 ::  nil) = 2 -> rk(Ap :: Bp :: Cp :: Dp :: Ep :: p5 ::  nil) = 5 -> rk(A :: p3 :: p5 ::  nil) = 2.
Proof.

intros A B C D E Ap Bp Cp Dp Ep p1 p2 p3 p4 p5 
HABCDEeq HApBpCpDpEpeq HABCDEApBpCpDpEpeq HAp1eq HABp1eq HApBpCpDpEpp1eq HAp2eq HACp2eq HApBpCpDpEpp2eq HAp3eq
HADp3eq HApBpCpDpEpp3eq HAp4eq HAEp4eq HApBpCpDpEpp4eq HBCp5eq HApBpCpDpEpp5eq .

(* dans constructProofaux(), preuve de 1 <= rg <= 2 pour Ap3p5 requis par la preuve de (?)Ap3p5 pour la règle 5  *)
(* dans constructProofaux(), preuve de 1 <= rg <= 3 pour Ap3p5 requis par la preuve de (?)Ap3p5 pour la règle 1  *)
(* Application de la règle 1 code (5 dans la thèse) conclusion AUB *)
(* marque des antécédents A B AiB : -4 -2 et 5*)
assert(HAp3p5M2 : rk(A :: p3 :: p5 :: nil) <= 2).
{
	assert(HAp3Mtmp : rk(A :: p3 :: nil) <= 1) by (solve_hyps_max HAp3eq HAp3M1).
	assert(Hp5Mtmp : rk(p5 :: nil) <= 1) by (solve_hyps_max Hp5eq Hp5M1).
	assert(Hmtmp : rk(nil) >= 0) by (solve_hyps_min Hnuleq Hm).
	assert(Hincl : incl (nil) (list_inter (A :: p3 :: nil) (p5 :: nil))) by (repeat clear_all_rk;my_inO).
	assert(HT1 : equivlist (A :: p3 :: p5 :: nil) (A :: p3 :: p5 :: nil)) by (clear_all_rk;my_inO).
	assert(HT2 : equivlist (A :: p3 :: p5 :: nil) ((A :: p3 :: nil) ++ (p5 :: nil))) by (clear_all_rk;my_inO).
	assert(HT := rule_1 (A :: p3 :: nil) (p5 :: nil) (nil) 1 1 0 HAp3Mtmp Hp5Mtmp Hmtmp Hincl);
	rewrite <-HT2 in HT;try rewrite <-HT1 in HT;apply HT.
}

(* Application de la règle 5 code (1 ou 2 dans la thèse) *)
(* marque de l'antécédent : 4 *)
assert(HAp3p5m2 : rk(A :: p3 :: p5 :: nil) >= 2).
{
	assert(HAp5eq : rk(A :: p5 :: nil) = 2) by (apply LAp5 with (A := A) (B := B) (C := C) (D := D) (E := E) (Ap := Ap) (Bp := Bp) (Cp := Cp) (Dp := Dp) (Ep := Ep) (p1 := p1) (p2 := p2) (p3 := p3) (p4 := p4) (p5 := p5) ; assumption).
	assert(HAp5mtmp : rk(A :: p5 :: nil) >= 2) by (solve_hyps_min HAp5eq HAp5m2).
	assert(Hcomp : 2 <= 2) by (repeat constructor).
	assert(Hincl : incl (A :: p5 :: nil) (A :: p3 :: p5 :: nil)) by (repeat clear_all_rk;my_inO).
	assert(HT := rule_5 (A :: p5 :: nil) (A :: p3 :: p5 :: nil) 2 2 HAp5mtmp Hcomp Hincl);apply HT.
}

assert(HAp3p5M : rk(A :: p3 :: p5 ::  nil) <= 3) (* dim : 5 *) by (solve_hyps_max HAp3p5eq HAp3p5M3).
assert(HAp3p5m : rk(A :: p3 :: p5 ::  nil) >= 1) by (solve_hyps_min HAp3p5eq HAp3p5m1).
intuition.
Qed.

