(* marque des antécédents AUB AiB A: 5 -2 et -4*)
(* ensembles concernés AUB : A :: C :: p1 :: p2 :: p4 :: p5 ::  de rang :  3 et 5 	 AiB : p2 ::  de rang :  1 et 1 	 A : A :: C :: p2 ::   de rang : 2 et 2 *)
assert(Hp1p2p4p5m2 : rk(p1 :: p2 :: p4 :: p5 :: nil) >= 2).
{
	assert(HACp2Mtmp : rk(A :: C :: p2 :: nil) <= 2) by (solve_hyps_max HACp2eq HACp2M2).
	assert(HACp1p2p4p5mtmp : rk(A :: C :: p1 :: p2 :: p4 :: p5 :: nil) >= 3) by (solve_hyps_min HACp1p2p4p5eq HACp1p2p4p5m3).
