	assert(Hincl : incl (p2 :: nil) (list_inter (A :: C :: p2 :: nil) (p1 :: p2 :: p4 :: p5 :: nil))) by (repeat clear_all_rk;my_inO).
	assert(HT1 : equivlist (A :: C :: p1 :: p2 :: p4 :: p5 :: nil) (A :: C :: p2 :: p1 :: p2 :: p4 :: p5 :: nil)) by (clear_all_rk;my_inO).
