	assert(HT := rule_4 (A :: C :: p2 :: nil) (p1 :: p2 :: p4 :: p5 :: nil) (p2 :: nil) 3 1 2 HACp1p2p4p5mtmp Hp2mtmp HACp2Mtmp Hincl); apply HT.
}

